import React, { useState } from "react";
import '../Components/Resume.css'
import MyResume from '../Images/MyResume2023.pdf'

export default function Resume() {
  const [isOpen, setIsOpen] = useState(false);

  const handleButtonClick = () => {
    setIsOpen(!isOpen);
  };

  return (
    <div className="resume-container">
      <h1 className="resume-title">My Resume</h1>
      {isOpen ? (
        <div className="resume-popup">
          <iframe src={MyResume} className="resume-pdf" title="My Resume" />
          <button className="resume-close-button" onClick={handleButtonClick}>
            Close Resume
          </button>
        </div>
      ) : (
        <button className="resume-open-button" onClick={handleButtonClick}>
          Open Resume
        </button>
      )}
    </div>
  );
}
